import React from 'react';

//for routing from here for our nav
import {BrowserRouter, Link, Route, Switch} from 'react-router-dom';

//import components for router
import StreamList from './streams/StreamList';
import StreamCreate from './streams/StreamCreate';
import StreamShow from './streams/StreamShow';
import StreamDelete from './streams/StreamDelete';
import StreamEdit from './streams/StreamEdit';

//Nav Header
import Header from './Header';

function App () {
  return (
    //this is how you set up routing for your app! The path defines the page in the url and then the component is where
    //the route is matched and renders that component (page)
    (
      <div className="ui container">
        {/*mount header above browser router and it will put header in every component automatically for us!*/}
        <Header />
        <BrowserRouter>
          <Switch>
            <Route path="/" exact component={StreamList} />
            <Route path="/streams/new" exact component={StreamCreate} />
            <Route path="streams/show" exact component={StreamShow} />
            <Route path="/streams/delete" exact component={StreamDelete} />
            <Route path="/streams/edit" exact component={StreamEdit} />
          </Switch>
        </BrowserRouter>
      </div>
    )
  );
}

export default App;
